    [],nt"num_tags": 3,nt"name": "sand-lake-wetland-management-district-annual-narrative-report-calendar-year-1983",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Sand Lake
    WMD outlines Refuge accomplishments during the 1983 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. Refuge administration is outlined; information about personnel, funding,
    and safety is given. Habitat management is also covered; subjects include wetlands,
    croplands, grasslands, grazing, pest control, and WPA easements. The wildlife section
    of the report discusses waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, fisheries resources, and wildlife propagation. The public uses of
    the Refuge described in this report include outdoor classrooms, hunting, fishing,
    trapping, and wildlife observation. The equipment and facilities section of the
    report provides information about new construction and rehabilitation. Items of
    interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
